import axios from 'axios';
import React from 'react'
import { setDesertCards } from '../../../Redux/slices/DesertCard';
import { useDispatch, useSelector } from 'react-redux';

function DesertCard() {
    const dispatch = useDispatch()
    const Desert = useSelector(state => state.DesertCard.DesertCards)
    React.useEffect(() => {
        if (Desert.length === 0) {
          axios
            .get('https://demo5518646.mockable.io/DrinksCard')
            .then((res) => {
              dispatch(setDesertCards(res.data));
            });
        }
      }, []);

  return (
    <div>
      {Desert.map(card => <div><h1>{card.name}</h1></div>)}
    </div>
  )
}

export default DesertCard
